import React from "react";
import "./Home.scss";

const Home = () => {
  return (
    <div className="home">
      <div className="hero section">
        <h1>Explore to find inspiration for your next vacation</h1>
      </div>
      <div className="suggestions section">section 2</div>
      <div className="top-articles section">section 3</div>
      <div className="subscribe section">section 4</div>
    </div>
  );
};

export default Home;
